import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import { Container, Navbar, Nav } from 'react-bootstrap';
import LandingPage from '../LandingPage/LandingPage';
import CodingPage from '../CodingPage/CodingPage';
import ComicsPage from '../ComicsPage/ComicsPage';
import ContactPage from '../ContactPage/ContactPage';


function App() {
  return (
    <Router>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand as={Link} to="/">My App</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link as={<LandingPage/>} to="/">
              <img
              src="./images/actual-logo.png"
              alt="Logo"
              />
              </Nav.Link>
              <Nav.Link as={<CodingPage/>} to="/coding">Coding</Nav.Link>
              <Nav.Link as={<ComicsPage/>} to="/comics"></Nav.Link>
              <Nav.Link as={<ContactPage/>} to="/contact"></Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

function Home() {
  return <h1>Home</h1>;
}

function About() {
  return <h1>About</h1>;
}

function Contact() {
  return <h1>Contact</h1>;
}

export default App;
